Texts:
  Texts_1:
    texts_name: Home-niezalogowany-welcome-text
    texts_value: "                    <h1><span class=\"blue\">Smashintracks.com</span> specialise in unique and unsigned music producers.</h1><br />\r\n                    <p><strong>Featuring Music you will not find anywhere else!</strong></p><br />\r\n                    <p>Downloading is simple, Register below then just add any number of tracks to your cart and pay securely using <strong>Paypal</strong>.</p><br />\r\n                    <p><strong>All mp3s are 'dj friendly' 320 Kbps Bitrate unless otherwise stated.</strong></p><br />\r\n                    <p>For any general enquiries, or if you are interested in selling your music at <a href=\"#\" class=\"underline\">Smashintracks.com</a> please register in the members section below</p><br />\r\n                    <p>ONLY BIG TUNE'S WILL BE FOR SALE ON THIS SITE!!!</p>"
    texts_help: ''
  Texts_2:
    texts_name: Home-niezalogowany-recommends-10-smashin-trac
    texts_value: '<p>Here''s a hand picked selection of smashing tracks personally recommended by <a class="underline" href="#">Smashintracks.com</a> in this week.</p>'
    texts_help: ''
  Texts_3:
    texts_name: Home-niezalogowany-new-tracks
    texts_value: "<p>Here are the latest <span class=\"blue\">10 tunes</span> on <a href=\"#\" class=\"underline\">Smashintracks.com</a><br />\r\n                        Click the button 'FULL LIST' if you want see list of new tracks from latest months.</p>"
    texts_help: ''
  Texts_4:
    texts_name: Home-niezalogowany-bestsellers-tracks
    texts_value: "<p>Here are <span class=\"blue\">10 most popular tracks</span> on <a href=\"#\" class=\"underline\">Smashintracks.com</a> from latest week.<br />\r\n                        Click the button 'FULL LIST' if you want see lists of new more charts.</p>"
    texts_help: ''
  Texts_5:
    texts_name: Charts-This-Week-main-text
    texts_value: "                        <p>Here are the list with <span class=\"blue\">30</span> bestsellers in this week on <a href=\"http://smashintracks.com/\" class=\"underline\">Smashintracks.com</a><br />\r\n                        See also other ‘CHARTS’.</p>"
    texts_help: ''
  Texts_6:
    texts_name: FAQ-main-text
    texts_value: "<p>Tutaj znajdziesz odpowiedzi na wszytskie nurtujace cie pytania na temat <br />\r\n                        dzialania tej strony.</p>"
    texts_help: ''
  Texts_7:
    texts_name: Genre-list-main-text
    texts_value: '                        Here are the latest <span class="blue">__GENRESNAME__ </span> tracks that have been uploaded through producers on <a href="#" class="underline">Smashintracks.com</a> Check this out!'
