  Texts_22:
    texts_name: ZALOGOWANY-Home-my-downloads
    texts_value: '<p><span>Jesli kupowales jakies tracki na <a href="http://smashintracks.com/" class="underline">Smashintracks.com</a> tutaj zobaczysz pelna historie swoich zakupow...</span></p>'
    texts_help: ''
  Texts_23:
    texts_name: ZALOGOWANY-Home-my-wishlist
    texts_value: '<p><span>Jesli masz liste trackow ktore ci sie spodobaly, w tym miejscu mozesz je przesluchac, kupic lub skasowac...</span></p>'
    texts_help: ''
  Texts_24:
    texts_name: ZALOGOWANY-Home-my-profile
    texts_value: '<p><span>Tutaj mozesz zedytowac swoje dane takie jak zmiana hasla, maila, profil artysty, fota etc...</span></p>'
    texts_help: ''
  Texts_25:
    texts_name: ZALOGOWANY-My-sales-main-text
    texts_value: '<p>Jesli sprzedajesz tracki na <a href="#" class="underline">Smashintracks.com</a> tutaj mozesz obejrzec jak sie sprzedaja, ile juz zarobiles oraz wyplacic pieniadze.</p>'
    texts_help: ''
  Texts_26:
    texts_name: ZALOGOWANY-My-sales-Minimalna-kwota-wyplaty
    texts_value: '<p>Minimalna kwota wyplaty to <strong>__KWOTA__</strong></p>'
    texts_help: '__KWOTA__ - kwota'
  Texts_27:
    texts_name: Charts-Last-3-months-main-text
    texts_value: "                        <p>Here are the list with <span class=\"blue\">30</span> bestsellers in this week on <a href=\"http://smashintracks.com/\" class=\"underline\">Smashintracks.com</a><br />\r\n                        See also other ‘CHARTS’.</p>"
    texts_help: ''
  Texts_28:
    texts_name: Charts-All-time-main-text
    texts_value: "                        <p>Here are the list with <span class=\"blue\">30</span> bestsellers in this week on <a href=\"http://smashintracks.com/\" class=\"underline\">Smashintracks.com</a><br />\r\n                        See also other ‘CHARTS’.</p>"
    texts_help: ''
  Texts_29:
    texts_name: Artists-all-main-text
    texts_value: "<p>Sed vitae tellus dui, <span class=\"blue\">non condimentum</span> purus. Sed vitae tellus dui, non <br />\r\n                        condimentum purus. See also other 'CHARTS'.</p>"
    texts_help: ''
  Texts_30:
    texts_name: Koszyk-Order-Oczekiwanie-main-text
    texts_value: '<p><strong>Transakcja jest w trakcie realizacji.</strong> Zaczekaj parę chwil i nie zamykaj tej strony. Za moment otrzymasz tutaj link do zakupionych  przez ciebie tracków...</p>'
    texts_help: ''
  Texts_31:
    texts_name: ZALOGOWANY-Home-Odwiedzin-Twojego
    texts_value: '<p>Odwiedziny twojego profilu: &nbsp; <strong>__ILOSC__</strong></p>'
    texts_help: '__ILOSC__ - ilość'
  Texts_32:
    texts_name: ZALOGOWANY-Home-my-sales
    texts_value: '<p><span>Jesli sprzedajesz tracki na <a href="http://smashintracks.com/" class="underline">Smashintracks.com</a> tutaj mozesz obejrzec jak sie sprzedaja i ile juz zarobiles...</span></p>'
    texts_help: ''
  Texts_33:
    texts_name: Zmiana-hasla-main-text
    texts_value: '<p>Please select a clever new password below.</p>'
    texts_help: ''
  Texts_34:
    texts_name: Kontakt-main-text
    texts_value: "<p>Jesli chcesz skontaktowac sie z nami skorzystaj z formularza ponizej.<br />\r\n                            Jesli masz problem z realizacja kupionych trackow nie zapomnij o <span class=\"blue\">kodzie zakupu</span>.</p>"
    texts_help: ''
  Texts_35:
    texts_name: Kontakt-message-send
    texts_value: '<p>Your message has been send.</p>'
    texts_help: ''
  Texts_36:
    texts_name: ZALOGOWANY-Wyplata-pieniedzy-zgloszenie-wysla
    texts_value: '<p><strong>Zgloszenie wyplaty zostalo pomyslnie wyslane. Twoje pieniadze w przeciagu <span class="blue">2-3 dni roboczych</span> powinny<br /> znalezc sie, na podanym przez ciebie koncie <span class="blue">PAYPAL</span>.</strong></p>'
    texts_help: ''
  Texts_37:
    texts_name: ZALOGOWANY-Wyplata-pieniedzy-main-text
    texts_value: "<div class=\"bw-div1\">\r\n                        Your current balance available to spend or withdraw is...\r\n                    </div>\r\n                    <div id=\"bw3-div1\">\r\n                        Your balance:    <strong>__BALANCE__</strong>\r\n                    </div>\r\n                    <div id=\"bw3-div2\">\r\n                        If you would like your money paying to you via <span class=\"blue\">PayPal</span> you will need a minimum ballance of <span class=\"blue\">£10.00</span> first.\r\n                    </div>"
    texts_help: '__BALANCE__ - stan konta'
  Texts_38:
    texts_name: ZALOGOWANY-Wyplata-pieniedzy-spend-it-on
    texts_value: "<p>You can spend what you have earned instantly on <a href=\"#\" class=\"underline\">Smashintracks.com</a><br /><br />\r\n\r\n                        When goto the checkout click <span class=\"blue\">Pay with money earned on <a href=\"#\" class=\"underline\">Smashintracks.com</a></span><br />\r\n                        and what you spend on tunes will be deducted from your earnings.</p>"
    texts_help: ''
  Texts_39:
    texts_name: ZALOGOWANY-Wyplata-pieniedzy-your-paypal
    texts_value: '<p>Click the link bellow and we will send you your earnings on <span class="blue">your PayPal</span> account.</p>'
    texts_help: ''
  Texts_40:
    texts_name: ZALOGOWANY-Wyplata-pieniedzy-sorry
    texts_value: '<p>Sorry but the minimum withrawal limit is <strong>£10</strong></p>'
    texts_help: ''
  Texts_41:
    texts_name: ZALOGOWANY-Upload-Track-main-text
    texts_value: "<p>W tym miejscu mozesz uploadowac swoje tracki. Limit wynosi <span class=\"blue\">__LIMIT__ tracki w ciagu dnia.</span><br />\r\n                                W przeciagu <span class=\"blue\">24 godzin</span> od wyslania track zostanie <span class=\"blue\">zaakceptowany i dodany do sklepu.</span><br />\r\n                                Milej zabawy.</p>"
    texts_help: '__LIMIT__ - limit'
  Texts_42:
    texts_name: ZALOGOWANY-Upload-Track-sukces
    texts_value: '<p>Twoj track zostal pomyslnie zuploadowany. W przeciagu 24 godzin od wyslania track zostanie zaakceptowany i dodany do sklepu. Kliknij button <strong>OK</strong> aby zamknąć to okno.</p>'
    texts_help: ''
  Texts_43:
    texts_name: ZALOGOWANY-Upload-Track-limit
    texts_value: '<p><strong>Niestety ale dzisiaj wykorzystales juz caly dostepny limit uploadowanych trackow <span class="blue">(__LIMIT__ na dobe)</span>. Zapraszamy za kilkanascie godzin.</strong></p>'
    texts_help: '__LIMIT__ - limit'
  Texts_44:
    texts_name: ZALOGOWANY-My-Tracks-All
    texts_value: "<p>W tej sekcji mozesz zobaczyc jak czesto sa przesluchiwane twoje tracki, <br />\r\n                        kupowane oraz dodawane do innych 'wishlist'.</p>"
    texts_help: ''
  Texts_45:
    texts_name: ZALOGOWANY-My-Tracks-Most-Popular
    texts_value: "<p>W tej sekcji mozesz zobaczyc jak czesto sa przesluchiwane twoje tracki, <br />\r\n                        kupowane oraz dodawane do innych 'wishlist'.</p>"
    texts_help: ''
  Texts_46:
    texts_name: ZALOGOWANY-My-Tracks-in-wishlists
    texts_value: "<p>W tej sekcji mozesz zobaczyc jak czesto sa przesluchiwane twoje tracki, <br />\r\n                        kupowane oraz dodawane do innych 'wishlist'.</p>"
    texts_help: ''
  Texts_47:
    texts_name: ZALOGOWANY-My-downloads-main-text
    texts_value: "<p>Tutaj obejrzysz historie swoich zakupow. Jesli kupiles tracki w przeciagu 24 godzin\r\n                        w tym miejscu znajdziesz linki do ich pobrania.</p>"
    texts_help: ''
  Texts_48:
    texts_name: ZALOGOWANY-My-Wishlist-last-added
    texts_value: '<p>W tym miejscu widzisz swoja liste <span class="blue">‘Wishlist’</span>. Dzieki niej mozesz zachowywac w pamieci swojego profilu tracki ktore chcialbys kupic w przyszlosci etc.</p>'
    texts_help: ''
  Texts_49:
    texts_name: ZALOGOWANY-My-Wishlist-by-artist
    texts_value: '<p>W tym miejscu widzisz swoja liste <span class="blue">‘Wishlist’</span>. Dzieki niej mozesz zachowywac w pamieci swojego profilu tracki ktore chcialbys kupic w przyszlosci etc.</p>'
    texts_help: ''
  Texts_50:
    texts_name: ZALOGOWANY-My-Profile-main-text
    texts_value: "<p>Jesli sprzedajesz tracki na <span class=\"blue\">SmashinTracks.com</span> warto zaktualizowac swoj profil\r\n                                o <span class=\"blue\">informacje o sobie, zdjecie/logo</span> - beda one widoczne przez wszystkich\r\n                                odwiedzajacych twoj profil.</p>"
    texts_help: ''
  Texts_51:
    texts_name: ZALOGOWANY-My-Profile-main-settings
    texts_value: '<p>Tutaj mozesz zmienic swoje podstawowe dane takie jak <span class="blue">artist name, e-mail, haslo.</span></p>'
    texts_help: ''
